import React, { useState, useEffect } from 'react';
import axios from 'axios';

const ResourceTable = () => {
  const [resources, setResources] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [resourceID, setResourceID] = useState(''); // State to hold the resource ID input
  const [regionFilter, setRegionFilter] = useState(''); // State to hold region filter
  const [typeFilter, setTypeFilter] = useState(''); // State to hold type filter

  // Function to fetch all resources with optional filters
  const fetchAllResources = () => {
    const apiUrl = `http://localhost:8080/api/resources?region=${regionFilter}&type=${typeFilter}`; // Include filters in the URL
    setLoading(true);
    axios.get(apiUrl)
      .then(response => {
        console.log('Fetched all resources:', response.data); // Debugging
        setResources(response.data);
        setLoading(false);
      })
      .catch(error => {
        console.error('Error fetching resources:', error); // Debugging
        setError('Failed to fetch resources');
        setLoading(false);
      });
  };

  // Function to fetch a specific resource by ID
  const fetchResourceByID = (id) => {
    const apiUrl = `http://localhost:8080/api/resources/${id}`; // Adjust the URL to your backend
    setLoading(true);
    axios.get(apiUrl)
      .then(response => {
        console.log('Fetched resource by ID:', response.data); // Debugging
        setResources([response.data]); // Set the response as the only resource in the list
        setLoading(false);
      })
      .catch(error => {
        console.error('Error fetching resource by ID:', error); // Debugging
        setError('Failed to fetch resource by ID');
        setLoading(false);
      });
  };

  useEffect(() => {
    fetchAllResources(); // Fetch resources when the component mounts
  }, [regionFilter, typeFilter]); // Re-fetch when filters change

  const handleRegionChange = (event) => {
    setRegionFilter(event.target.value); // Update the region filter as the user types
  };

  const handleTypeChange = (event) => {
    setTypeFilter(event.target.value); // Update the type filter as the user types
  };

  const handleIDChange = (event) => {
    setResourceID(event.target.value); // Update the resource ID as the user types
  };

  const handleFetchByID = () => {
    if (resourceID) {
      setLoading(true); // Set loading state
      fetchResourceByID(resourceID); // Fetch the resource by ID
    } else {
      setError('Please enter a valid resource ID');
    }
  };

  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>{error}</div>;
  }

  return (
    <div>
      {/* Input fields and buttons for search */}
      <div>
        <input
          type="text"
          value={regionFilter}
          onChange={handleRegionChange}
          placeholder="Search by Region"
        />
        <input
          type="text"
          value={typeFilter}
          onChange={handleTypeChange}
          placeholder="Search by Type"
        />
        <button onClick={fetchAllResources}>Search</button>
      </div>

      {/* Input and button to fetch a resource by ID */}
      <div>
        <input
          type="text"
          value={resourceID}
          onChange={handleIDChange}
          placeholder="Enter Resource ID"
        />
        <button onClick={handleFetchByID}>Fetch Resource by ID</button>
      </div>

      {/* Table to display the resources */}
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Region</th>
            <th>Type</th>
            <th>Status</th>
            <th>IP</th>
            <th>Created Time</th>
          </tr>
        </thead>
        <tbody>
          {resources.map(resource => (
            <tr key={resource.name}>
              <td>{resource.name}</td>
              <td>{resource.zone}</td>
              <td>{resource.type}</td>
              <td>{resource.status || 'N/A'}</td>
              <td>{resource.ipAddresses && resource.ipAddresses.length > 0 ? resource.ipAddresses.join(', ') : 'N/A'}</td>
              <td>{resource.creationTimestamp || 'N/A'}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ResourceTable;
